    false,nt"url": null,nt"notes": "This report summarizes the results from
    the 2012 black-tailed prairie dog (Cynomus ludovicianus) population survey at Fort
    Niobrara National Wildlife Refuge.  This survey is conducted to monitor trends in
    abundance and distribution of black-tailed prairie dogs on Fort Niobrara National
    Wildlife Refuge.  Annual black-tailed prairie dog population surveys are conducted
    after young-of-the-year prairie dogs have emerged from their burrows and yearlings
    have dispersed (mid-June to late August).  Prairie dog location, abundance, and
    distribution is reported for the refuge.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
